import'./Component.css'
import Background from '../picture/background1.jpg'
function Backgroundimg() {
    return (
      <div className="backkode">
         <img src={Background} alt="gambar tidak tersedia" className="bgimage"/>
      </div>
        
        
    );
  }
  export default Backgroundimg;
